import { Navbar, Nav } from "react-bootstrap";
import Logo from "../assets/images/logo.png"

function NavigationBar() {
    return (
        <Navbar bg="dark" variant="dark">
            <Navbar.Brand>
                BombPot
            </Navbar.Brand>
            <Nav>
                <Nav.Link href="home">Home</Nav.Link>
            </Nav>
        </Navbar>
    );
}

export default NavigationBar;
